  return (
    <header className="w-full h-[70px] bg-orange-500">
      <nav className="">
        <ul className="">
          <li className="block text-white font-bold">Home</li>
          <li className="block text-white font-bold">Contact Us</li>
          <li className="block text-white font-bold">Support</li>
        </ul>
      </nav>
    </header>
  );
};
